SET FOREIGN_KEY_CHECKS=0; 
DROP TABLE IF EXISTS `zs_mail`;
CREATE TABLE `zs_mail` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(4) DEFAULT '0' COMMENT '注册邮箱',
  `email` varchar(100) DEFAULT NULL COMMENT '接收邮箱',
  `content` text COMMENT '发送内容',
  `verify` char(6) DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1' COMMENT '1正常 2已使用',
  `error_info` text COMMENT '邮件信息',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  `use_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `type` (`type`,`email`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COMMENT='邮箱';

DROP TABLE IF EXISTS `zs_migration`;
CREATE TABLE `zs_migration` (
  `version` varchar(180) NOT NULL,
  `apply_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`version`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4;

DROP TABLE IF EXISTS `zs_pan`;
CREATE TABLE `zs_pan` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(4) DEFAULT '0' COMMENT '0上证指数',
  `today_price` decimal(10,2) DEFAULT '0.00' COMMENT '今日开盘',
  `yesterday_price` decimal(10,2) DEFAULT '0.00',
  `current_price` decimal(10,3) DEFAULT '0.000' COMMENT '当前时刻价格',
  `up_price` decimal(10,3) DEFAULT '0.000' COMMENT '上一次价格',
  `top_price` decimal(10,2) DEFAULT '0.00' COMMENT '今日最高价',
  `down_price` decimal(10,2) DEFAULT '0.00',
  `tran_num` int(13) DEFAULT '0' COMMENT '成交股票数',
  `tran_money` decimal(15,0) DEFAULT '0' COMMENT '成交金额',
  `date` date DEFAULT NULL COMMENT '当前成交日期',
  `time` time DEFAULT NULL COMMENT '当前成交时间',
  `up_date` date DEFAULT NULL COMMENT '上一次成交日期',
  `up_time` time DEFAULT NULL COMMENT '上一次成交时间',
  `content` text COMMENT '所有数据',
  `compare` tinyint(4) DEFAULT '0' COMMENT '与上一次对比 0未开奖 涨跌问题 1涨 2跌',
  PRIMARY KEY (`id`),
  KEY `id` (`id`,`type`)
) ENGINE=MyISAM AUTO_INCREMENT=510 DEFAULT CHARSET=utf8mb4 COMMENT='盘数据';
