DROP TABLE IF EXISTS `zs_sys_help`;
CREATE TABLE `zs_sys_help` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(150) DEFAULT NULL,
  `content` text,
  `status` tinyint(4) DEFAULT '1' COMMENT '1正常',
  `sort` tinyint(4) DEFAULT '100',
  `views` int(11) DEFAULT '0',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `sort` (`sort`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COMMENT='帮助';

DROP TABLE IF EXISTS `zs_sys_manage`;
CREATE TABLE `zs_sys_manage` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL,
  `account` varchar(50) DEFAULT NULL,
  `password` char(32) DEFAULT NULL,
  `salt` char(5) DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1' COMMENT '1正常 2禁用',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `account` (`account`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COMMENT='系统管理员';

DROP TABLE IF EXISTS `zs_sys_setting`;
CREATE TABLE `zs_sys_setting` (
  `type` varchar(20) NOT NULL DEFAULT '',
  `content` text,
  PRIMARY KEY (`type`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COMMENT='系统缓存数据';

DROP TABLE IF EXISTS `zs_user`;
CREATE TABLE `zs_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(4) DEFAULT '0' COMMENT '普通用户 1会员用户',
  `level` tinyint(4) DEFAULT '0' COMMENT '0 会员等级',
  `username` varchar(50) DEFAULT NULL,
  `face` varchar(100) DEFAULT NULL COMMENT '头像',
  `email` varchar(100) DEFAULT NULL COMMENT '用户邮箱',
  `password` char(32) DEFAULT NULL,
  `salt` char(5) DEFAULT NULL,
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '货币余额',
  `history_money` decimal(10,2) DEFAULT '0.00' COMMENT '历史累计',
  `pay_pwd` char(32) DEFAULT NULL COMMENT '支付密码',
  `pay_salt` char(5) DEFAULT NULL,
  `auth_key` varchar(50) DEFAULT NULL,
  `access_token` varchar(100) DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1' COMMENT '1正常 2禁用',
  `fuid1` int(11) DEFAULT '0' COMMENT '当前用户的上级',
  `fuid2` int(11) DEFAULT '0' COMMENT '当前用户的上上级',
  `fuid3` int(11) DEFAULT '0' COMMENT '当前用户的上上上级',
  `vote_times` int(11) DEFAULT '0' COMMENT '累计投票次数',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fuid1` (`fuid1`,`fuid2`,`fuid3`),
  KEY `fuid2` (`fuid2`,`fuid3`),
  KEY `fuid3` (`fuid3`),
  KEY `type` (`type`,`level`),
  KEY `username` (`username`),
  KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8mb4 COMMENT='用户表';

DROP TABLE IF EXISTS `zs_user_chat`;
CREATE TABLE `zs_user_chat` (
  `id` bigint(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid1` int(11) DEFAULT NULL COMMENT '聊天对象用户id uid1小于uid2',
  `uid2` int(11) DEFAULT NULL COMMENT '聊天对象用户id uid1小于uid2',
  `suid` int(11) DEFAULT '0' COMMENT '发送者id',
  `type` tinyint(4) DEFAULT '0' COMMENT '0文本 1图片',
  `content` text,
  `is_read` tinyint(4) DEFAULT '0' COMMENT '0未读 1已读',
  `status` tinyint(4) DEFAULT '1',
  `read_time` datetime DEFAULT NULL,
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `uid1` (`uid1`,`uid2`),
  KEY `create_time` (`create_time`),
  KEY `suid` (`suid`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COMMENT='用户聊天记录';

DROP TABLE IF EXISTS `zs_user_complaint`;
CREATE TABLE `zs_user_complaint` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL COMMENT '发起投诉者用户id',
  `c_uid` int(11) DEFAULT NULL COMMENT '被投诉者id',
  `content` int(11) DEFAULT NULL,
  `img` text,
  `status` tinyint(4) DEFAULT '1' COMMENT '1创建',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`,`c_uid`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COMMENT='用户投诉';

DROP TABLE IF EXISTS `zs_user_friend`;
CREATE TABLE `zs_user_friend` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL,
  `f_uid` int(11) DEFAULT NULL,
  `is_black` tinyint(4) DEFAULT '0' COMMENT '小黑屋状态',
  `is_know` tinyint(4) DEFAULT '1' COMMENT '1认识 0陌生人',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`,`f_uid`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COMMENT='好友表';

DROP TABLE IF EXISTS `zs_user_money_logs`;
CREATE TABLE `zs_user_money_logs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT '0' COMMENT '用户id',
  `origin_money` decimal(10,2) DEFAULT '0.00' COMMENT '变动前余额',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '变动余额',
  `new_money` decimal(10,2) DEFAULT '0.00' COMMENT '变动后余额',
  `intro` varchar(255) DEFAULT NULL COMMENT '说明',
  `extra` text COMMENT '扩展数据',
  `create_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `create_time` (`create_time`)
) ENGINE=InnoDB AUTO_INCREMENT=81 DEFAULT CHARSET=utf8mb4;

DROP TABLE IF EXISTS `zs_user_withdraw`;
CREATE TABLE `zs_user_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL,
  `money` int(11) DEFAULT NULL COMMENT '上架额度',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `label` char(5) DEFAULT '0' COMMENT '支付方式',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4 COMMENT='用户提现表';

DROP TABLE IF EXISTS `zs_vote`;
CREATE TABLE `zs_vote` (
  `id` bigint(11) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL,
  `wid` int(11) DEFAULT NULL COMMENT '等待开奖的id',
  `type` tinyint(4) DEFAULT '0' COMMENT '0上证指数',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '压金额',
  `per` decimal(3,2) DEFAULT '0.00' COMMENT '手续费',
  `result_money` decimal(10,2) DEFAULT '0.00' COMMENT '扣除费率 剩余金额',
  `is_up` tinyint(4) DEFAULT '0' COMMENT '购买的状态1涨 2跌',
  `award_state` tinyint(4) DEFAULT '0' COMMENT '开奖状态 1涨 2跌',
  `is_win` tinyint(4) DEFAULT '0' COMMENT '1赢 2输',
  `get_money` decimal(10,2) DEFAULT '0.00' COMMENT '奖励额度',
  `status` tinyint(4) DEFAULT '1' COMMENT '1创建',
  `open_time` datetime DEFAULT NULL COMMENT '开奖时间',
  `create_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `wid` (`wid`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8mb4 COMMENT='投票';

